import React from "react";

function Especificacoes () {
    return(
<div class="esp">

<div class="esp-content">
    <div class="esp1">HTML CSS</div>
    <div class="esp2">JAVA SCRIPT</div>
    <div class="esp3">REACT</div>
    <div class="esp4">NODEJS</div>
    <div class="esp5">BANCO DE DADOS SQL</div>
</div>


</div>
    )
}

export default Especificacoes
